// SPDX-License-Identifier: Apache-2.0

pragma solidity ^0.8.0;


/**
 * @dev Coin defines a token with a denomination and an amount.
 */
struct Coin {
    string denom;
    uint256 amount;
}
/**
 * @dev DecCoin defines a token with a denomination and a decimal amount.
 */
struct DecCoin {
    string denom;
    uint256 amount;
    uint8 precision;
}
/**
 * @dev Dec defines decimal with a precision. for example, amount:16800, precision:3 means is 16.800
 */
struct Dec {
    uint256 amount;
    uint8 precision;
}
/**
 * @dev PageRequest is to be embedded in request messages for efficient pagination
 */
struct PageRequest {
    // key is a value returned in PageResponse.next_key to begin
    // querying the next page most efficiently. Only one of offset or key
    // should be set.
    bytes key;
    // offset is a numeric offset that can be used when key is unavailable.
    // It is less efficient than using key. Only one of offset or key should
    // be set.
    uint64 offset;
    // limit is the total number of results to be returned in the result page.
    // If left empty it will default to a value to be set by each app.
    uint64 limit;
    // countTotal is set to true to indicate that the result set should include
    // a count of the total number of items available for pagination in UIs.
    // count_total is only respected when offset is used. It is ignored when key
    // is set.
    bool countTotal;
    // reverse is set to true if results are to be returned in the descending order.
    bool reverse;
}
/**
 * @dev PageResponse is to be embedded in gRPC response messages where the
 * corresponding request message has used PageRequest.
 */
struct PageResponse {
    // nextKey is the key to be passed to PageRequest.key to
    // query the next page most efficiently. It will be empty if
    // there are no more results.
    bytes nextKey;
    // total is total number of results available if PageRequest.count_total
    // was set, its value is undefined otherwise
    uint64 total;
}

/**
 * @dev Output defines the send coins info.
 */
struct Output {
    address toAddress;
    Coin[] amount;
}

/**
 * @dev SendEnabled maps coin denom to a send_enabled status (whether a denom is
 * sendable).
 */
struct SendEnabled {
    string denom;
    bool enabled;
}

/**
 * @dev Params defines the parameters for the bank module.
 */
struct Params {
    SendEnabled[] sendEnabled;
    bool defaultSendEnabled;
}
/**
 * @dev DenomUnit represents a struct that describes a given
 * denomination unit of the basic token.
 */
struct DenomUnit {
    // denom represents the string name of the given denom unit (e.g uatom).
    string denom;
    // exponent represents power of 10 exponent that one must
    // raise the base_denom to in order to equal the given DenomUnit's denom
    // 1 denom = 1^exponent base_denom
    // (e.g. with a base_denom of uatom, one can create a DenomUnit of 'atom' with
    // exponent = 6, thus: 1 atom = 10^6 uatom).
    uint32 exponent;
    // aliases is a list of string aliases for the given denom
    string[] aliases;
}

/**
 * @dev Metadata represents a struct that describes a basic token.
 */
struct Metadata {
    string description;
    // denomUnits represents the list of DenomUnit's for a given coin
    DenomUnit[] denomUnits;
    // base represents the base denom (should be the DenomUnit with exponent = 0).
    string base;
    // display indicates the suggested denom that should be
    // displayed in clients.
    string display;
    // name defines the name of the token (eg: Cosmos Atom)
    string name;
    // symbol is the token symbol usually shown on exchanges (eg: ATOM). This can
    // be the same as the display.
    string symbol;
    // URI to a document (on or off-chain) that contains additional information. Optional.
    string uri;
    // URIHash is a sha256 hash of a document pointed by URI. It's used to verify that
    // the document didn't change. Optional.
    string uriHash;
}

/**
 * @dev DenomOwner defines structure representing an account that owns or holds a
 * particular denominated token. It contains the account address and account
 * balance of the denominated token.
 */
struct DenomOwner {
    address accountAddress;
    Coin balance;
}

interface IBank {
    /**
     * @dev send defines a method for sending coins from one account to another account.
     */
    function send(
        address toAddress,
        Coin[] memory amount
    ) external returns (bool success);

    /**
     * @dev multiSend defines a method for sending coins from some accounts to other accounts.
     */
    function multiSend(
        Output[] memory outputs
    ) external returns (bool success);

    /**
     * @dev mintCoins defines a method for QOE mint coins to module account bank.
     */
    function mintCoins(Coin[] memory amount) external returns (bool success);

    /**
     * @dev distributeCoins defines a method for QOE distribute coins from module account bank to another account.
     */
    function distributeCoins(
        address toAddress,
        Coin[] memory amount
    ) external returns (bool success);

    /**
     * @dev burnCoins defines a method for burn his coins.
     */
    function burnCoins(Coin[] memory amount) external returns (bool success);

    /**
     * @dev balance queries the balance of a single coin for a single account.
     */
    function balance(
        address accountAddress,
        string memory denom
    ) external view returns (Coin memory balance);

    /**
     * @dev allBalances queries the balance of all coins for a single account.
     */
    function allBalances(
        address accountAddress,
        PageRequest memory pageRequest
    )
        external
        view
        returns (Coin[] memory balances, PageResponse memory pageResponse);

    /**
     * @dev totalSupply queries the total supply of all coins.
     */
    function totalSupply() external view returns (Coin[] memory supply);

    /**
     * @dev spendableBalances queries the spenable balance of all coins for a single account.
     */
    function spendableBalances(
        address accountAddress,
        PageRequest memory pageRequest
    ) external view returns (Coin[] memory balances, PageResponse memory pageResponse);

    /**
     * @dev supplyOf queries the supply of a single coin.
     */
    function supplyOf(string memory denom) external view returns (Coin memory amount);

    /**
     * @dev params queries the parameters of x/bank module.
     */
    function params() external view returns (Params memory params);

    /**
     * @dev denomMetadata queries the client metadata of a given coin denomination.
     */
    function denomMetadata(string memory denom) external view returns (Metadata memory metadata);

    /**
     * @dev denomsMetadata queries the client metadata for all registered coin denominations.
     */
    function denomsMetadata(
        PageRequest memory pageRequest
    ) external view returns (Metadata[] memory metadatas, PageResponse memory pageResponse);

    /**
     * @dev DenomOwners queries for all account addresses that own a particular token denomination.
     */
    function denomOwners(
        string memory denom,
        PageRequest memory pageRequest
    ) external view returns (DenomOwner[] memory denomOwners, PageResponse memory pageResponse);

    /**
     * @dev Send defines an Event emitted when a given amount of tokens send fromAddress to toAddress
     */
    event Send(
        address indexed fromAddress,
        address indexed toAddress,
        string amount
    );

    /**
     * @dev MultiSend defines an Event emitted when a given amount of tokens send from a address to some other addresses
     */
    event MultiSend(
        address indexed fromAddress,
        string amount
    );

    /**
     * @dev MintCoins defines an Event emitted QOE mint coins to module account bank.
     */
    event MintCoins(address indexed qoeAddress, string amount);

    /**
     * @dev DistributeCoins defines an Event emitted when QOE distribute coins from module account bank to another
     */
    event DistributeCoins(
        address indexed qoeAddress,
        address indexed toAddress,
        string amount
    );

    /**
     * @dev BurnCoins defines an Event emitted when user burn his coins.
     */
    event BurnCoins(address indexed fromAddress, string amount);
}

