// SPDX-License-Identifier: Apache-2.0

pragma solidity ^0.8.0;


/**
 * @dev Coin defines a token with a denomination and an amount.
 */
struct Coin {
    string denom;
    uint256 amount;
}
/**
 * @dev DecCoin defines a token with a denomination and a decimal amount.
 */
struct DecCoin {
    string denom;
    uint256 amount;
    uint8 precision;
}
/**
 * @dev Dec defines decimal with a precision. for example, amount:16800, precision:3 means is 16.800
 */
struct Dec {
    uint256 amount;
    uint8 precision;
}
/**
 * @dev PageRequest is to be embedded in request messages for efficient pagination
 */
struct PageRequest {
    // key is a value returned in PageResponse.next_key to begin
    // querying the next page most efficiently. Only one of offset or key
    // should be set.
    bytes key;
    // offset is a numeric offset that can be used when key is unavailable.
    // It is less efficient than using key. Only one of offset or key should
    // be set.
    uint64 offset;
    // limit is the total number of results to be returned in the result page.
    // If left empty it will default to a value to be set by each app.
    uint64 limit;
    // countTotal is set to true to indicate that the result set should include
    // a count of the total number of items available for pagination in UIs.
    // count_total is only respected when offset is used. It is ignored when key
    // is set.
    bool countTotal;
    // reverse is set to true if results are to be returned in the descending order.
    bool reverse;
}
/**
 * @dev PageResponse is to be embedded in gRPC response messages where the
 * corresponding request message has used PageRequest.
 */
struct PageResponse {
    // nextKey is the key to be passed to PageRequest.key to
    // query the next page most efficiently. It will be empty if
    // there are no more results.
    bytes nextKey;
    // total is total number of results available if PageRequest.count_total
    // was set, its value is undefined otherwise
    uint64 total;
}

enum GasAllowanceType {
    Basic,
    Periodic
}

struct Allowance {
    GasAllowanceType allowanceType;
    Coin spendLimit;
    int64 period;
    Coin periodSpendLimit;
    int64 periodReset;
}

struct NormalGasWaiver {
    address contractAddress;
    Allowance allowance;
    address owner;
    int64 createdAt;
    int64 updateAt;
}

struct AccountGasWaiverMeter {
    Coin totalUsage;
    Coin periodicUsage;
    int64 periodReset;
    int64 period;
}

struct GasWaiverApplication {
    address granter;
    string expiration;
    address contractAddress;
    Allowance allowance;
    address owner;
    string applyEndTime;
}

interface IGasWaiver {
    /**
     * @dev grantGasWaiverGranter grants a gas waiver granter to contract with the provided expiration time.
     */
    function grantGasWaiverGranter(
        address contractAddress,
        string memory expiration,
        Allowance memory allowance
    ) external returns (bool success);

    /**
     * @dev revokeGasWaiverGranter defines an operation to revoke a gas waiver granter.
     */
    function revokeGasWaiverGranter(
        address contractAddress
    ) external returns (bool success);

    /**
     * @dev applyGasWaiverGranter applies for gas waiver granted to a contract
     */
    function applyGasWaiverGranter(
        address contractAddress,
        string memory expiration,
        Allowance memory allowance,
        int64 applyPeriod
    ) external returns (bool success);

    /**
     * @dev cancelApplication defines an operation to cancel an application from granter (applicant).
     */
    function cancelApplication(
        address contractAddress,
        address applicant
    ) external returns (bool success);

    /**
     * @dev approveApplication approves an application from granter (applicant).
     */
    function approveApplication(
        address contractAddress,
        address granter
    ) external returns (bool success);

    /**
     * @dev grantPremiumGasWaiver a gas waiver that can only be used by an appointed
     * account/address to a contract with the provided expiration time.
     */
    function grantPremiumGasWaiver(
        address contractAddress,
        address grantee,
        Allowance memory allowance
    ) external returns (bool success);

    /**
     * @dev revokePremiumGasWaiver defines an operations to revoke a premium gas waiver
     * that can only be used by an appointed account/address.
     */
    function revokePremiumGasWaiver(
        address contractAddress,
        address grantee
    ) external returns (bool success);

    /**
     * @dev updateAllowance updates the allowance of the normal or premium gas waiver.
     */
    function updateAllowance(
        address contractAddress,
        address grantee,
        Allowance memory allowance
    ) external returns (bool success);

    /**
     * @dev gasWaiverGranterInfo queries the gas waiver granter for a contract.
     */
    function gasWaiverGranterInfo(
        address contractAddress
    ) external view returns (address granter, int64 expiration);

    /**
     * @dev normalGasWaiver queries the normal gas waiver for a contract.
     */
    function normalGasWaiver(
        address contractAddress
    ) external view returns (address granter, NormalGasWaiver calldata waiver);

    /**
     * @dev normalGasWaiverMeter queries the normal gas waiver meter for an account.
     */
    function normalGasWaiverMeter(
        address contractAddress,
        address grantee
    ) external view returns (AccountGasWaiverMeter calldata meter);

    /**
     * @dev gasWaiverApplications queries a list of GasWaiverApplications items.
     */
    function gasWaiverApplications(
        address granter,
        address owner,
        PageRequest calldata pagination
    ) external view returns (GasWaiverApplication[] calldata applications, PageResponse calldata pageResponse);

    /**
     * @dev premiumGasWaiver queries the premium gas waiver for a contract and an account.
     */
    function premiumGasWaiver(
        address contractAddress,
        address grantee
    ) external view returns (address granter, NormalGasWaiver calldata waiver);

    /**
     * @dev premiumGasWaiverMeter queries the premium gas waiver meter for an account.
     */
    function premiumGasWaiverMeter(
        address contractAddress,
        address grantee
    ) external view returns (AccountGasWaiverMeter calldata meter);

    /**
     * @dev normalGasWaivers queries a list of NormalGasWaiver items.
     */
    function normalGasWaivers(
        address owner,
        PageRequest calldata pagination
    ) external view returns (NormalGasWaiver[] calldata waivers, PageResponse calldata pageResponse);

    /**
     * @dev GrantGasWaiverGranter defines an Event emitted when grants a gas waiver granter to contract.
     */
    event GrantGasWaiverGranter(
        address indexed owner,
        address indexed contractAddress
    );

    /**
     * @dev RevokeGasWaiverGranter defines an Event emitted when revoke a gas waiver granter.
     */
    event RevokeGasWaiverGranter(
        address indexed sender,
        address indexed contractAddress
    );

    /**
     * @dev ApplyGasWaiverGranter defines an Event emitted applies for gas waiver granted to a contract
     */
    event ApplyGasWaiverGranter(
        address indexed granter,
        address indexed contractAddress
    );

    /**
     * @dev CancelApplication defines an Event emitted when an operation to cancel an application from granter (applicant).
     */
    event CancelApplication(
        address indexed sender,
        address indexed contractAddress,
        address indexed applicant
    );

    /**
     * @dev approveApplication defines an Event emitted approves an application from granter (applicant).
     */
    event ApproveApplication(
        address indexed owner,
        address indexed contractAddress,
        address indexed granter
    );

    /**
     * @dev GrantPremiumGasWaiver defines an Event emitted when grants a premium gas waiver granter to contract.
     */
    event GrantPremiumGasWaiver(
        address indexed owner,
        address indexed contractAddress,
        address indexed grantee
    );

    /**
     * @dev RevokePremiumGasWaiver defines an Event emitted when an operations to revoke a premium gas waiver
     * that can only be used by an appointed account/address.
     */
    event RevokePremiumGasWaiver(
        address indexed granter,
        address indexed contractAddress,
        address indexed grantee
    );

    /**
     * @dev UpdateAllowance defines an Event emitted when updates the allowance of the normal or premium gas waiver.
     */
    event UpdateAllowance(
        address indexed granter,
        address indexed contractAddress,
        address indexed grantee
    );
}

