// SPDX-License-Identifier: Apache-2.0

pragma solidity ^0.8.0;


/**
 * @dev Coin defines a token with a denomination and an amount.
 */
struct Coin {
    string denom;
    uint256 amount;
}
/**
 * @dev DecCoin defines a token with a denomination and a decimal amount.
 */
struct DecCoin {
    string denom;
    uint256 amount;
    uint8 precision;
}
/**
 * @dev Dec defines decimal with a precision. for example, amount:16800, precision:3 means is 16.800
 */
struct Dec {
    uint256 amount;
    uint8 precision;
}
/**
 * @dev PageRequest is to be embedded in request messages for efficient pagination
 */
struct PageRequest {
    // key is a value returned in PageResponse.next_key to begin
    // querying the next page most efficiently. Only one of offset or key
    // should be set.
    bytes key;
    // offset is a numeric offset that can be used when key is unavailable.
    // It is less efficient than using key. Only one of offset or key should
    // be set.
    uint64 offset;
    // limit is the total number of results to be returned in the result page.
    // If left empty it will default to a value to be set by each app.
    uint64 limit;
    // countTotal is set to true to indicate that the result set should include
    // a count of the total number of items available for pagination in UIs.
    // count_total is only respected when offset is used. It is ignored when key
    // is set.
    bool countTotal;
    // reverse is set to true if results are to be returned in the descending order.
    bool reverse;
}
/**
 * @dev PageResponse is to be embedded in gRPC response messages where the
 * corresponding request message has used PageRequest.
 */
struct PageResponse {
    // nextKey is the key to be passed to PageRequest.key to
    // query the next page most efficiently. It will be empty if
    // there are no more results.
    bytes nextKey;
    // total is total number of results available if PageRequest.count_total
    // was set, its value is undefined otherwise
    uint64 total;
}

/**
 * @dev Params represents the parameters used for by the slashing module.
 */
struct Params {
    int64 signedBlocksWindow;
    string minSignedPerWindow;
    int64 downtimeJailDuration;
    string slashFractionDoubleSign;
    string slashFractionDowntime;
}

/**
 * @dev ValidatorSigningInfo defines a validator's signing info for monitoring their
 * liveness activity.
 */
struct ValidatorSigningInfo {
    address consAddress;
    // Height at which validator was first a candidate OR was unjailed
    int64 startHeight;
    // Index which is incremented each time the validator was a bonded
    // in a block and may have signed a precommit or not. This in conjunction with the
    // `SignedBlocksWindow` param determines the index in the `MissedBlocksBitArray`.
    int64 indexOffset;
    // Timestamp until which the validator is jailed due to liveness downtime.
    int64 jailedUntil;
    // Whether or not a validator has been tombstoned (killed out of validator set). It is set
    // once the validator commits an equivocation or for any other configured misbehiavor.
    bool tombstoned;
    // A counter kept to avoid unnecessary array reads.
    // Note that `Sum(MissedBlocksBitArray)` always equals `MissedBlocksCounter`.
    int64 missedBlocksCounter;
}

interface ISlashing {
    /**
     * @dev unjail defines a method for unjailing a jailed validator, thus returning
     * them into the bonded validator set, so they can begin receiving provisions
     * and rewards again.
     */
    function unjail() external returns (bool success);

    /**
     * @dev Params queries the parameters of slashing module
     */
    function params() external view returns (Params memory params);

    /**
     * @dev signingInfo queries the signing info of given cons address
     */
    function signingInfo(address consAddress) external view returns (ValidatorSigningInfo memory valSigningInfo);

    /**
     * @dev signingInfos queries signing info of all validators
     */
    function signingInfos(PageRequest calldata pagination) external view returns (ValidatorSigningInfo[] memory infos, PageResponse memory pageResponse);

    /**
     * @dev Unjail defines an Event emitted when a validtor unjail
     */
    event Unjail(
        address indexed validator
    );
}

